const List = () => {
  return (
    <div>
      <h1>Things to do<span>soon</span></h1>
      <p>Interesting things I want to check out</p>
      <section>
        <article>
          <h2>Books</h2>
        </article>
        <article>
          <h2>Movies</h2>
        </article>
        <article>
          <h2>Games</h2>
        </article>
      </section>
    </div>
  );
};

export default List;
